import React from "react";
import { Button } from "@nextui-org/react";
import {Link, useLocation} from "react-router-dom";

const Register: React.FC = () => {
    const inputClass = "w-full border rounded p-2"
    const location = useLocation();

    return (
        <div className="flex flex-col items-center justify-start min-h-screen bg-gray-100 w-full">
            <div className=" w-[500px] bg-white py-5 px-24 rounded-lg shadow-lg flex flex-col gap-2 m-30">
                <div className="w-full flex justify-center items-center gap-5 my-5">
                    <Link to="/register" className={`bold ${location.pathname === "/register" ? "text-blue-500" : "text-black" }`}>Register</Link>
                    |
                    <Link to="/login" className={` bold ${location.pathname === "/login" ? "text-blue-500" : "text-black"}`}>Login</Link>
                </div>
                <input placeholder="Username"
                       className={inputClass}
                />
                <input
                    placeholder="Password"
                    type="password"
                    className={inputClass}
                />
                <button className="w-full mb-4 border rounded bg-[#1560BD] text-white py-2 transition hover:bg-[#0f488e]" color="primary">
                    Login
                </button>
                <div className="flex gap-2 mt-4 justify-center">
                    <Button color="primary" className="border rounded px-5">
                        Google
                    </Button>
                    <Button color="primary" className="border rounded px-5">
                        Facebook
                    </Button>
                </div>
            </div>
        </div>
    );
};

export default Register;
